import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    homeBotao: {
        backgroundColor: "#db3022", 
        width: "90%", 
        paddingHorizontal: 10,
        height: "48px", 
        borderRadius: 25, 
        shadowColor: "rgba(211, 38, 38, 0.25)", 
        shadowOffset: {
            width: 0,
            height: 4
        },
        shadowRadius: 8,
        elevation: 8,
        shadowOpacity: 1,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        marginTop: "250px",
    },
})
